// import logo from './logo.svg';
import '../App.css';
import {useState,useEffect}from"react";
function SerchDat() {
  var [lData,setData]=useState([]);
  async function data_get(){
    var resp=await fetch("http://127.0.0.1:8000/api/serch");
    var data=await resp.json();
    setData(data);
  }
  useEffect(()=>{
    data_get();
  },[]
  );
  return (
    <div>
        for
      <table className="table table-hover">
    <thead>
      <tr>
        <th>Name</th>
        <th>Price</th>
        <th>Description</th>
        <th>Add User</th>
        <th>Update</th>
        <th>Delete</th>
      </tr>
    </thead>
    <tbody>
      {lData.map(row=>
      <tr>
        <td>{row.productName}</td>
        <td>{row.price}</td>
        <td>{row.decription}</td>
        <td>{row.name}</td>
        <td><button className="btn btn-danger">Remove</button></td>
        <td></td>
      </tr>
      )}
    </tbody>
  </table>
    </div>
  );
}

export default SerchDat;
